# Importing additional libraries for clustering
from sklearn.cluster import KMeans
from sklearn.metrics import silhouette_score
import matplotlib.pyplot as plt

# Step 1: Perform clustering for different values of k (scaled features)
def clustering_analysis(data, max_k=10, scale_features=True):
    if scale_features:
        data = StandardScaler().fit_transform(data)  # Scale the data if required

    inertia = []
    silhouette_scores = []
    k_values = range(2, max_k + 1)

    for k in k_values:
        kmeans = KMeans(n_clusters=k, random_state=42)
        kmeans.fit(data)
        inertia.append(kmeans.inertia_)
        silhouette_scores.append(silhouette_score(data, kmeans.labels_))

    return k_values, inertia, silhouette_scores


# Clustering analysis for scaled features
k_scaled, inertia_scaled, silhouette_scaled = clustering_analysis(X_all, max_k=10, scale_features=True)

# Clustering analysis for unscaled features
k_unscaled, inertia_unscaled, silhouette_unscaled = clustering_analysis(X_all, max_k=10, scale_features=False)

# Q 2: Plot results
def plot_clustering_results(k_values, inertia, silhouette_scores, title_suffix):
    plt.figure(figsize=(12, 6))

    # Plot Inertia
    plt.subplot(1, 2, 1)
    plt.plot(k_values, inertia, marker='o')
    plt.title(f"Inertia vs. Number of Clusters ({title_suffix})")
    plt.xlabel("Number of Clusters (k)")
    plt.ylabel("Inertia")

    # Plot Silhouette Scores
    plt.subplot(1, 2, 2)
    plt.plot(k_values, silhouette_scores, marker='o')
    plt.title(f"Silhouette Score vs. Number of Clusters ({title_suffix})")
    plt.xlabel("Number of Clusters (k)")
    plt.ylabel("Silhouette Score")

    plt.tight_layout()
    plt.show()


